const Avatar = ({ HandleOpen }) => {
  return (
    <div className="flex flex-row items-center ">
      <div className="text-white font-bold">
        <p> Yochiro Lee Cruz</p>
      </div>
      <div className="bg-white mx-4">
        <img
          className=" rounded-full  w-8 h-8 "
          src="img/avatar.jpg"
          alt="Avatar"
        />
      </div>
      <ShoppingCartButton HandleOpen={HandleOpen} />
    </div>
  );
};

const ShoppingCartButton = ({ HandleOpen }) => {
  return (
    <div className='flex flex-col flex-wrap items-center'> 
     <span className='fixed w-6 h-6 text-center mb-3 pb-2 text-white rounded-full bg-red-600 '>90</span>
      <button
        onClick={HandleOpen}
        className="border-none text-2xl flex items-center px-3  border rounded text-gray-200 border-gray-400 hover:text-white hover:border-white"
      >
        <i className="fa fa-shopping-cart"></i>
      </button>
     
    </div>
  );
};

export default Avatar;
